import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const images = [
    'https://via.placeholder.com/300x200?text=Image+1',
    'https://via.placeholder.com/300x200?text=Image+2',
    'https://via.placeholder.com/300x200?text=Image+3',
    'https://via.placeholder.com/300x200?text=Image+4',
    'https://via.placeholder.com/300x200?text=Image+5',
    'https://via.placeholder.com/300x200?text=Image+6'
  ];
const PropertyDetail = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 1,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1,
              infinite: true,
              dots: true
            }
          }
        ]
      };
  return (
    <div>
      <div className="max-w-4xl mx-auto p-4">
          
      <div className="container mx-auto px-4">
      <Slider {...settings}>
        {images.map((image, index) => (
          <div key={index} className="p-2">
            <img src={image} alt={`Slide ${index + 1}`} className="w-full h-auto" />
          </div>
        ))}
      </Slider>
    </div>
          
          <div className="grid grid-cols-4 gap-4 mt-4 p-4 bg-card text-card-foreground rounded-lg shadow">
            <div className="text-center">
              <h3 className="text-lg font-semibold text-[#fead26]">PRICE</h3>
              <p className="text-muted-foreground">4.60 Cr* Onwards</p>
            </div>
            <div className="text-center">
              <h3 className="text-lg font-semibold text-[#fead26]">SIZES</h3>
              <p className="text-muted-foreground">2600 Sq.Ft.* Onwards</p>
            </div>
            <div className="text-center">
              <h3 className="text-lg font-semibold text-[#fead26]">CONFIGURATIONS</h3>
              <p className="text-muted-foreground">3.5 & 4.5 BHK Apartments</p>
            </div>
            <div className="text-center">
              <h3 className="text-lg font-semibold text-[#fead26]">STATUS</h3>
              <p className="text-muted-foreground">New Launch</p>
            </div>
          </div>
        </div>
    </div>
  )
}

export default PropertyDetail
